from u_utils import list_of_bool_int_fields


def dhe_features(machine, field_prefix):
    res = []
    res += list_of_bool_int_fields(machine, '{}'.format(field_prefix), ['dhe_support',
                                                                        'dhe_export_support',
                                                                        'ecdhe_support',
                                                                        'export_dhe_support',
                                                                        'export_rsa_support',
                                                                        'extended_random_extended_random_support'],
                                   'Does it support this field?')
    res += tls_f.dh_param_features(machine,
                                   field_prefix='{}_dhe'.format(field_prefix),
                                   _id_prefix=field_prefix,
                                   echd=False)
    res += tls_f.dh_param_features(machine,
                                   field_prefix='{}_dhe_export'.format(field_prefix),
                                   _id_prefix=field_prefix,
                                   echd=False)
    res += tls_f.dh_param_features(machine,
                                   field_prefix='{}_ecdhe'.format(field_prefix),
                                   _id_prefix=field_prefix,
                                   echd=True)

    res += tls_f.dh_param_features(machine,
                                   field_prefix='{}_export_dhe'.format(field_prefix),
                                   _id_prefix=field_prefix,
                                   echd=False,
                                   mini=True)
    return res


def heartbeat_features(machine, field_prefix):
    return [
        Feature(as_obj={
            '_id': '{}_HEARTBEAT_ENABLED'.format(field_prefix),
            '_type': 'MACHINE',
            'expansion_safe': True,
            'value': get_field(machine,
                               '{}_heartbleed_heartbeat_enabled'.format(field_prefix)),
            'description': 'is Heart beat enabled?'
        }),
        Feature(as_obj={
            '_id': '{}_HEARTBLEED_VULNERABLE'.format(field_prefix),
            '_type': 'MACHINE',
            'expansion_safe': True,
            'value': get_field(machine,
                               '{}_heartbleed_heartbleed_vulnerable'.format(field_prefix)),
            'description': 'is vulnerable to heart bleed?'
        }),
    ]


def ssl_features(machine, field_prefix):
    res = []
    res += list_of_bool_int_fields(machine=machine, parent_field='{}'.format(field_prefix),
                                   child_fields=['ssl_2_export',
                                                 'ssl_2_extra_clear',
                                                 'ssl_2_support',
                                                 'ssl_3_support'], description='https ssl feature. ')
    return res


def rsa_export_features(m, field_prefix):
    res = [
        Feature(as_obj={
            '_id': '{}_RSA_EXPORT_SUPPORT'.format(field_prefix),
            '_type': 'MACHINE',
            'expansion_safe': True,
            'value': get_field(m, '{}_rsa_export_support'.format(field_prefix)),
            'description': 'True if the host supports '
                           'export-grade RSA in TLS handshakes.'
        }),
        Feature(as_obj={
            '_id': '{}_RSA_EXPORT_rsa_params_length'.format(field_prefix),
            '_type': 'MACHINE',
            'expansion_safe': True,
            'value': get_field(m, '{}_rsa_export_rsa_params_length'.format(field_prefix)),
            'description': 'Bit-length of modulus.'
        }),
        Feature(as_obj={
            '_id': '{}_export_rsa_rsa_params_length'.format(field_prefix),
            '_type': 'MACHINE',
            'expansion_safe': True,
            'value': get_field(m, '{}_export_rsa_rsa_params_length'.format(field_prefix)),
            'description': 'Bit-length of modulus.'
        })
    ]
    return res


def tls_meta_features(m, field_prefix):
    res = [
        Feature(as_obj={
            '_id': '{}_TLS_1_1_SUPPORT'.format(field_prefix),
            '_type': 'MACHINE',
            'expansion_safe': True,
            'value': get_field(m, '{}_tls_1_1_support'.format(field_prefix)),
            'description': 'Does the cert have tls1.1 support'
        }),
        Feature(as_obj={
            '_id': '{}_TLS_1_2_SUPPORT'.format(field_prefix),
            '_type': 'MACHINE',
            'expansion_safe': True,
            'value': get_field(m, '{}_tls_1_2_support'.format(field_prefix)),
            'description': 'Does the cert have tls1.2 support'
        }),
        Feature(as_obj={
            '_id': '{}_TLS_1_3_SUPPORT'.format(field_prefix),
            '_type': 'MACHINE',
            'expansion_safe': True,
            'value': get_field(m, '{}_tls_1_3_support'.format(field_prefix)),
            'description': 'Does the cert have tls1.3 support'
        })
    ]

    return res


def extract(machine, args):
    protocol = 'https'
    res = []
    ports = [p for c in const.ports_and_protocols
             if c[0] == protocol
             for p in c[1]]
    for port in sorted(ports, reverse=True):
        field_prefix = 'p{}_{}'.format(port, protocol)

        res += http_f.get_features(machine, '{}_get'.format(field_prefix))
        if port == 443:
            res += dhe_features(machine, field_prefix)
            res += heartbeat_features(machine, field_prefix)
            res += rsa_export_features(machine, field_prefix)
            res += ssl_features(machine, field_prefix)
            res += tls_meta_features(machine, field_prefix)
            res += tls_f.extract(machine,
                                 args,
                                 field=field_prefix,
                                 _id=field_prefix)
    return res


